import LegendItem from "./LegendItem";

const legendItems = [
  new LegendItem("7 +", "#002088", (cases) => cases > 6), // #d17c0 // "#7c3600"
  new LegendItem("6", "#0036a8", (cases) => cases === 6), // "#974d00"
  new LegendItem("5", "#004ec7", (cases) => cases === 5), // "#b36400"
  new LegendItem("4", "#0166e5", (cases) => cases === 4), // #d17c00
  new LegendItem("3", "#1180fe", (cases) => cases === 3), // ef9400
  new LegendItem("2", "#549bff", (cases) => cases === 2), // #ef9400 // feb423
  new LegendItem("1", "#cee3ff", (cases) => cases === 1), // #feb423 // ffda51
  new LegendItem("No mentions", "#9bd0ff", (cases) => cases === 0), // "#ffda51" // ffe996
  // new LegendItem("No data", "#ffffff", (cases) => true),
];

// #00186d,#002f8d,#0947ab,#2d5ec7,#5175e1,#6f8dfd,#8fa9ff,#afc6ff,#cee3ff - slightly purple

// #002088,#0036a8,#004ec7,#0166e5,#1180fe,#549bff,#7ab6ff,#9bd0ff,#baebff - blues
export default legendItems;
